import React from "react";

import {
    Grid
}
from "../index";

import "./tgButton.css";

const tgButton = () => {
    const styles = {
        margin: "0px"
    };

    return (
        <div>
            <Grid columns={2}>
                <label className="tg-btn__label text-right">{props.label}</label>
                <label className="tg-btn__label" style={styles}> 
                    <input className="tg-btn__checkbox" type="checkbox"/>
                    <div className="tg-btn">
                        <span className="tg-btn__slider"></span>
                    </div>
                </label>
            </Grid>
        </div>
    );
}

export default tgButton;
